    "FaqsData": "<ol class=\"questions\">\n<li> و\n<H6> هل يمكنني وضع النظام؟ </ H6>\n<p> نعم، UCM (يونيفرسال كرافت السوق) تسليم مستمرة حاليا. ومع ذلك، قد تكون أوقات تسليم أطول من المعتاد. يرجى عدم استخدام عناوين تسليم المباني التي قد تكون مغلقة بسبب الوضع الحالي (مثل المكاتب). </ P>\n</ لى>\n<li> و\n<H6> ويل UCM (الحرف السوق العالمي) تقديم حزمة؟ </ H6>\n<p> ونحن نعمل على مدار الساعة لضمان توافر هذه المنتجات، والاستمرار في جلب قدرة إضافية لتقديم طلبات العملاء. نحن مستمرون في السفينة عن اختيار المتاحة في جعبتنا. </ P>\n</ لى>\n<li> و\n<H6> كيف يمكنني تتبع شحنة بلدي؟ </ H6>\n<p> ويمكنك تتبع الشحنة الخاصة بك على UCM (سوق الحرف العالمي) بالضغط <a href=\"/Home/TrackOrder\"> تتبع طلبك </A>. </ P>\n</ لى>\n<li> و\n<H6> هل ما زلت العودة أوامري؟ </ H6>\n<p> نعم، يمكنك إنشاء العوائد. لمزيد من المعلومات، يرجى زيارة موقعنا على <a href=\"/Home/GuaranteeReturnPolicy\"> العوائد والمردودات سياسة </A> </ P>\n</ لى>\n<li> و\n<H6> هل هو آمن لتلقي الأوامر؟ </ H6>\n<p> ونحن دائما الأولوية لسلامة عملائنا وشركاء التسليم لدينا. وسوف نستمر في تقديم فقط حيث أنها آمنة للقيام بذلك. للحصول على إرشادات حول COVID-19، يرجى الرجوع إلى <a href=\"https://www.who.int/emergencies/diseases/novel-coronavirus-2019\" target=\"_blank\"> لمنظمة الصحة العالمية موقع </A> </ P>\n</ لى>\n<li> و\n<H6> ما هو UCM (الحرف السوق العالمي) القيام حول تلاعب في الاسعار؟ </ H6>\n<p> وليس هناك مكان للتلاعب في الاسعار على UCM (السوق العالمي الحرف اليدوية). يمكننا أن نؤكد أننا لا نشارك في التسعير زيادة. انخفاض العروض بأسعار يبيعون بسرعة، تاركة العروض بأسعار أعلى من البائعين طرف ثالث. نحن نراقب بنشاط موقعنا على الانترنت وإزالة العروض التي تتجاوز بشكل كبير في الآونة الأخيرة متوسط ​​سعر البيع. </ P>\n</ لى>\n</ OL>",
