    "guaranteeReturnPolicy": "<p> ونحن سعداء جدا لرؤيتكم يجري عملائنا، وأود أن أشكركم على التسوق في موقعنا على شبكة الإنترنت. </ p>\n<p> إذا كنت غير راض تماما مع عملية الشراء، ونحن هنا للمساعدة. </ p>\n<h5> عودة </h5>\n<p> لديك 14 يوما للعودة عنصر من التاريخ الذي تلقى فيه. يجب أن يكون البند غير المستخدمة وبنفس الحالة التي تلقيتها منه من أجل أن يكون مؤهلا للعودة. يجب أن يكون هذا البند في التعبئة والتغليف والعلامات الأصلي. أنت أيضا بحاجة إلى تلقي صالح أو إثبات الشراء. </ p>\n<h5> استرداد الأموال </h5>\n<p> وعندما نتلقى البند الخاص بك، سيتم تفتيش عليها، وسوف نقوم بإعلامك أن تلقينا عاد البند الخاص بك. وسوف نقوم بإعلامك عن حالة استرداد الخاص بك على الفور بعد عملية التفتيش. لتسديدات، ونحن نتابع الطرق التالية تبعا لطريقة الدفع التي يختارها العميل. للحصول على النقد عند التسليم (cod)، سيعكس استرداد الأموال في حسابك المصرفي في غضون 1-7 أيام عمل بعد ان تم تفتيشه، التحقق من صحة وجمعها على عتبة العملاء. للالسداد رقميا (باستخدام جوجل الدفع، باي بال، الخ) وسيتم تجهيز المبلغ على الفور. لتسديدات لحساب المصدر (أي بطاقة الائتمان، بطاقة خصم والمصرفية صافي)، استرداد الخاص بك قد يستغرق 7-10 أيام للتفكير في حسابك المصرفي تبعا الشريك المصرفي. سوف تتلقى الائتمان الكامل في غضون فترة معينة من الأيام، وهذا يتوقف على البنك الذي تتعامل معه، والسياسات البطاقة وطريقة الدفع. </ p>\n<h5> شحن </h5>\n<p> وسوف تكون مسؤولة عن دفع تكاليف الشحن الخاصة بك للعودة البند الخاص بك (ق). تكاليف الشحن غير قابلة للاسترداد. إذا كنت تتلقى رد، سيتم خصم تكاليف إعادة الشحن من المبلغ الخاص بك. </ p>\n\n<h3> اتصل بنا </h3>\n<p> إذا كان لديك أي أسئلة حول كيفية العودة البند الخاص بك لنا أو على كيفية بدء استرداد الأموال، من فضلك لا تتردد في <a href=\"/home/contact\"> الاتصال بنا </a>. </p>",
