    "paymentMethodsData": "<h3> طريقة الدفع </h3>\n            <h5> طرق الدفع المقبولة </h5>\n            <p> نقبل في Universal Craft Market مجموعة متنوعة من طرق الدفع ، مثل بطاقات الائتمان والخصم ، و COD (نقدًا عند التسليم) وطرق الدفع الرقمية (مثل Google Pay ، و Apple Pay ، و PayPal). نقبل في بطاقات الائتمان - Visa و Mastercard و Discover و American Express و Diners Club و JCB. </p>\n            <p> <strong> ملاحظة </strong> في بعض الظروف ، قد يتم تقييد استخدام بطاقات ائتمان Visa و Mastercard. في مثل هذه الحالات ، ستوضح عملية الدفع الأمر وستتيح لك إضافة طريقة الدفع الافتراضية. </p>\n            <!--<h5> إدارة طرق الدفع </h5>\n            <p> يمكنك إدارة طرق الدفع الخاصة بك في قسم الدفع بحسابك. </p>\n            <p>\n                لإضافة أو تحديث طريقة دفع في حسابك:\n                <ol>\n                    <li> انتقل إلى قسم حسابك. </li>\n                    <li> في قسم خيارات الدفع ، سيُطلب منك تسجيل الدخول إلى حساب Universal Market الخاص بك. بعد تسجيل الدخول إلى حساب Universal Market الخاص بك ، قم بأي مما يلي: </li>\n                    <li>\n                        لإضافة طريقة دفع جديدة ، انقر فوق إضافة بطاقة. <br />\n                        لتعديل /تحديث /حذف طريقة الدفع ، حدد البطاقة المحفوظة من قسم \"بطاقات الائتمان والخصم الخاصة بك\" ثم انقر فوق الزر \"تعديل\" أو \"حذف\" وفقًا لمتطلباتك.\n\n                    </li>\n                    <li> اتبع التعليمات التالية التي تظهر على الشاشة. </li>\n                </ol>\n            </p>\n            <p>\n                <strong> لإضافة طريقة دفع جديدة أثناء تقديم الطلب: </strong>\n                <ol>\n                    <li> أضف العناصر إلى سلة التسوق الخاصة بك وتابع عملية الدفع. </li>\n                    <li> في رابط تحديد طريقة الدفع ، يمكنك إضافة تفاصيل بطاقة الائتمان أو الخصم الخاصة بك عن طريق اختيار إضافة بطاقة في قسم إضافة طريقة الدفع. </li>\n                    <li> استمر في تقديم طلبك </li>\n                </ol>\n            <p>\n                سيتم حفظ هذه التفاصيل وستظهر كبطاقة ائتمان /خصم عند تقديم طلب Universal market التالي.\n            </p>\n            <p> <strong> للتحقق من رقم هاتفك الجوال لطريقة الدفع نقدًا عند الاستلام (COD): </strong>\n                   <ol>\n                       <li> أثناء اختيار طريقة الدفع نقدًا عند التسليم ، يجب التحقق من رقم هاتفك المحمول وتسجيله في Universal Craft Market. </li>\n                       <li> بعد اختيار الدفع عند التسليم كطريقة التسليم ، سيُطلب منك إدخال كلمة مرور لمرة واحدة (OTP) سيتم إرسالها إلى رقم الهاتف المحمول المسجل في حسابك. </li>\n                       <li> بمجرد الانتهاء ، انقر فوق \"متابعة\" لمتابعة طلبك. </li>\n                   </ol>\n            </p>\n            <p>\n                <string> ملاحظة: </string> في حالة عدم استلام كلمة المرور لمرة واحدة:\n                <ol>\n                    <li> حدد إعادة إرسال OTP. </li>\n                    <li> تأكد من إدخال رقم الهاتف المحمول بشكل صحيح دون أية مسافات. للتعديل ، انقر فوق تغيير </li>\n                </ol>\n            </p>-->\n            <h3> دفع آمن </h3>\n            <p> جميع المدفوعات المقدمة إلينا آمنة وتتبع الامتثال SSL و PCI DSS. </p>\n            <p> باستخدام Visa /Mastercard /PayPal SSL: جميع معاملاتنا مؤمنة باستخدام بروتوكول SSL. يساعد استخدام بروتوكول SSL في تشفير البيانات والمعلومات بحيث يتم حماية تفاصيل البطاقة وجميع البيانات الحساسة الأخرى. </p>\n            <p> <strong> PCI: </strong> توفر معايير أمان بيانات صناعة بطاقات الدفع (PCI DSS) إرشادات للتجار تخبرهم بما يجب فعله لتأمين البيانات الحساسة أثناء معالجة الدفع. </p>\n            <p> <strong> ملاحظة: </strong> نحن لا نقوم بتخزين أو حفظ أي معلومات بطاقة على موقعنا على الإنترنت. </p>",
    "paymentNotify": "عن طريق النقر على \"ادفع الآن\"، أوافق والموافقة على السياسات والأحكام والشروط التي وضعتها ucraftmarket.com. وأنا أتفق والامتثال لحكم والتنظيم التي وضعتها اختصاص هذه الأمة ضد المدفوعات والمعاملات.\n\n<p> ووطريقة الدفع إما بطاقة الائتمان أو بطاقة الخصم المستخدمة من قبل العميل محمي بواسطة تشفير SSL وهو ما يعني أنه يحمي المعلومات الشخصية خلال المعاملات وكذلك غيرها من المعلومات الحساسة مثل أرقام بطاقات الائتمان وتسجيلات. شهادات SSL تستخدم للدفع على موقعنا على الانترنت تستخدم نفس المستوى من الأمان المستخدمة من قبل البنوك. نحن لا تخزن أو مشاركة أي من المعلومات وعدم استخدام تفاصيل الدفع الخاصة بك في أي مكان آخر. يرجى مراجعة موقعنا \"الشروط والأحكام\" و \"سياسة الخصوصية\" لمزيد من التفاصيل. </ P>",
