    "privacyPolicy": "سياسة الخصوصية",
    "privacyPolicyData": "<p> والحرفية السوق العالمي وتعمل وتدير ucraftmarket.com وتطبيقاتها والبرمجيات بما في ذلك الشركات التابعة لها. هذه الوثيقة يعلمك من سياساتنا فيما يتعلق بجمع واستخدام والكشف عن المعلومات الشخصية التي نتلقاها من المستخدمين عبر منصة لدينا. </p>\n<p> ونحن نستخدم معلوماتك الشخصية فقط لتحسين خدمة العملاء والخبرة. باستخدام برنامجنا، فإنك توافق على جمع واستخدام المعلومات وفقا لهذه السياسة. </p>\n\n<h3> جمع المعلومات واستخدام </h3>\n<p> ونحن قد يطلب منك أن تقدم لنا مع بعض المعلومات الشخصية التي يمكن استخدامها لاتصال أو التعرف عليك. شخصيا، قد تشمل معلومات تعريفية ولكن لا تقتصر على اسمك والعمر والجنس والموقع. </p>\n\n<h5> سجل البيانات </h5>\n<p> ونقوم بجمع المعلومات التي يرسلها متصفحك كلما قمت بزيارة موقعنا على الانترنت والتطبيقات. ويمكن أن تشمل هذه البيانات سجل المعلومات مثل عنوان ip جهاز الكمبيوتر الخاص بك، ونوع المتصفح وإصدار المتصفح وصفحات موقعنا التي تزورها، ووقت وتاريخ زيارتكم، والوقت الذي يقضيه في تلك الصفحات وإحصاءات أخرى مماثلة. وبالإضافة إلى ذلك، قد نستخدم خدمات طرف ثالث مثل برنامج google analytics التي تجمع، ورصد، وتحليل هذه البيانات. </p>\n\n<h5> الاتصالات </h5>\n<p> وقد نستخدم معلوماتك الشخصية للاتصال بك مع مواد تسويقية أو ترويجية وغيرها من المعلومات التي يتم استخدامها لزيادة قدرتنا على التركيز على العملاء والخبرة. قد نتصل المستخدمين عبر البريد الإلكتروني أو الرسائل الإخبارية أو وسائل أخرى. </p>\n\n<h5> ملفات تعريف الارتباط </h5>\n<p> وhttp الكوكيز أو الإنترنت الكوكيز، هي قطعة صغيرة من البيانات التي بنيت خصيصا لمتصفحات الإنترنت لتتبع، وتخصيص، وحفظ المعلومات حول جلسة لكل مستخدم. </p>\n<p> ويتم إرسال الكوكيز إلى متصفحك من موقع على شبكة الانترنت وتخزينها على جهاز التخزين الفعلي جهاز الكمبيوتر الخاص بك مثل القرص الصلب. نحن نستخدم الكوكيز لجمع المعلومات. يمكنك توجيه المتصفح لرفض كافة ملفات تعريف الارتباط أو للإشارة عندما يتم إرسال ملف تعريف الارتباط. ومع ذلك، إذا كنت لا تقبل ملفات تعريف الارتباط، قد لا تكون قادرا على استخدام بعض أجزاء من موقعنا. </p>\n\n<h5> الأمن </h5>\n<p> وأمن البيانات الخاصة بك هو من أعلى الأولوية والأهمية بالنسبة لنا. رغم كل الإجراءات الأمنية علينا أن نتذكر أنه لا يوجد طريقة انتقال عبر الإنترنت، أو طريقة لتخزين البيانات على جهاز التخزين الفعلي أو وسائل الإعلام غير آمنة 100٪. الوقت الذي نسعى فيه إلى استخدام وسائل مقبولة تجاريا لحماية البيانات الخاصة بك، ونحن لا يمكن أن تضمن لها الأمن المطلق. </p>\n\n<h3> تغييرات على سياسة الخصوصية هذه </h3>\n<p> وهذه الخصوصية هي فعالة اعتبارا من 2020/1/1، وستظل سارية المفعول إلا فيما يتعلق بأي تغييرات في أحكامها في المستقبل، والتي سوف تكون سارية المفعول فور نشرها على موقعنا. </p>\n<p> ونحن نحتفظ بحقنا في تحديث أو تغيير سياسة الخصوصية الخاصة بنا في أي وقت، ويجب أن تحقق هذه الخصوصية بشكل دوري. واستخدامك المستمر للخدمة بعد ما نشر أي تعديلات على سياسة الخصوصية في هذه الصفحة يشكل الاعتراف الخاص بك من التعديلات وموافقتك على الالتزام والتقيد سياسة الخصوصية المعدلة. إذا أردنا إجراء أي تغييرات جوهرية لسياسة الخصوصية هذه، وسوف نقوم بإعلامك إما عن طريق عنوان البريد الإلكتروني الذي قدموا لنا أو عن طريق وضع إشعار بارز على موقعنا. </p>\n\n<h3> اتصل بنا </h3>\n<p> إذا كان لديك أي أسئلة أو استفسارات فيما يتعلق أو حول سياسة الخصوصية هذه، من فضلك لا تتردد في <a href=\"/home/contact\"> الاتصال بنا </a>. </p>",
