    "registrationTCp1": "من خلال التسجيل معنا و / أو استخدام أي من مواقع أو خدماتنا، أو عن طريق الوصول إلى أي محتوى أو المواد التي نوفرها من خلال موقعنا على شبكة الإنترنت، فإنك توافق على شروط الاستخدام هذه. ونحن نحتفظ بالحق في معاينة وفحص جميع المنتجات التي سوف يتم بيعها على موقعنا. والبائع هو المسؤول عن الحفاظ على المنتجات ونوعية نفسه. ونحن نحتفظ بالحق في تقديرنا إلى تعديل أو تغيير هذه الشروط والأحكام في المستقبل.",
    "registrationTCp2": "استخدام منصة لدينا هو متاح فقط للأشخاص الذين يمكن أن تشكل عقود ملزمة قانونيا. الأشخاص الذين هم غير كفء لعقد بما في ذلك القصر، المعسرين لم تبرأ ذمتهم، الخ ليسوا مؤهلين للتسجيل كبائع. قاصر أي الذين تقل أعمارهم عن 18 عاما، ولا تسجل كبائع، للعمليات أو استخدام برنامجنا. تحتفظ UCM الحق في إنهاء التسجيل و / أو منعك من الوصول إلى الموقع في حال جاء إلى علمنا أن كنت قاصرا وغير مؤهلين لتسجيل كبائع. إذا قمت بتسجيل كعمل تجاري، فإنك تقر أنك توافق عليها كيان تجاري لقبول الشروط والأحكام.",
    "registrationTCp3": "أثناء استخدامك لموقعنا ، فإنك تقبل تقديم البيانات والمعلومات التي نطلبها من وقت لآخر. بصفتك بائعًا ، ستكون ملزمًا ومسؤولًا عن الحفاظ على سرية هذه البيانات والمعلومات ، بالإضافة إلى بيانات اعتمادك بما في ذلك اسم العرض واسم المستخدم وكلمة المرور. أنت توافق على أنه إذا قدمت أي بيانات أو معلومات خاطئة أو خاطئة أو قديمة أو جزئية أو كانت لدينا أسباب منطقية للاشتباه في أن أيًا منها لا يتوافق مع الشروط والأحكام ، فيحق لنا تعليق أو إنهاء الحساب أو منعك بشكل غير محدد من الوصول إلى البوابة.",
