    "whatisUCMp1": "تلتزم أعمالنا بأن يكون لها أقل التأثيرات البيئية السلبية على الطبيعة. جميع منتجاتنا مصنوعة يدويًا من قبل حرفيين يأخذون فقط المنتجات التي لا تضر بالطبيعة. جميع الأعمال اليدوية تتم باليد وليس بالآلات. نحن نشجع الحرفية على التصنيع الآلي. لا يمكن للآلة نسخ العواطف والفن في المنتج كما يمكن للحرفيين. سيؤدي هذا أيضًا إلى تحفيز الناس على حفظ الفن والثقافة من خلال عدم الاعتماد على الآلات. من خلال هذا ، سنحقق أيضًا بصمة منخفضة للكربون مما سيساعدنا على تقليل التأثير البيئي تجاه ظاهرة الاحتباس الحراري.",
